    def dfs(idx, path, rest):
        if idx == n * (n - 1) // 2:
            return 0

        if idx not in dp[idx]:
            dp[idx] = [0] * (n * (n - 1) // 2)

        if dp[idx][path]!= 0:
            return dp[idx][path]

        if path == 0:
            if idx == 0:
                res = 0
            else:
                res = dfs(idx - 1, 0, rest)
            if d[idx - 1] <= rest:
                res += d[idx - 1]
                rest -= d[idx - 1]
            dp[idx][path] = res
        elif path == 1:
            if idx == 0 or idx == n - 1:
                res = 0
            else:
                res = dfs(idx - 1, 0, rest)
            if d[idx - 1] <= rest:
                res += d[idx - 1]
                rest -= d[idx - 1]
            if d[idx + 1] <= rest:
                res += d[idx + 1]
                rest -= d[idx + 1]
            dp[idx][path] = res
        elif path == 2:
            if idx == 0 or idx == n - 1:
                res = 0
            else:
                res = dfs(idx - 1, 0, rest)
            if d[idx - 1] <= rest:
                res += d[idx - 1]
                rest -= d[idx - 1]
            if d[idx + 1] <= rest:
                res += d[idx + 1]
                rest -= d[idx + 1]
            if d[idx - 1] + d[idx + 1] <= rest:
                res += d[idx - 1] + d[idx + 1]
                rest -= d[idx - 1] + d[idx + 1]
            dp[idx][path] = res

        return dp[idx][path]

