    def dfs(node, white, black, current_sum):
        if node == -1:
            return 0

        nonlocal res

        if current_sum < 0:
            white += 1
            black -= 1
            current_sum += 1
        elif current_sum > 0:
            white -= 1
            black += 1
            current_sum -= 1

        res.append(max(white - black, 0))

        for neighbor in graph[node]:
            dfs(neighbor, white, black, current_sum)

    dfs(-1, white_count, black_count, 0)
    return " ".join(map(str, res))


