    for i, word in enumerate(words):
        # Check if the word starts with the last letter of the previous word
        if i > 0 and word[0] == words[i - 1][-1]:
            # Check if the word has been called out before during the game
            if word in last_called_out:
                # Check if the player who called out the word is the first player
                if last_called_out[word] == 1:
                    # The game was played according to the rules
                    return "Fair Game"
                else:
                    # The first player violated the rules and lost the game
                    return f"Player {last_called_out[word]} lost"
            # The word has not been called out before during the game
            else:
                # Store the player who called out the word and its index
                last_called_out[word] = i
                last_called_out_players.append(i)

    # Check if there was a tie in the game
    if len(set(last_called_out_players)) == 1:
        # The game was played according to the rules
        return "Fair Game"
    else:
        # The first player who called out the word is the winner
