class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

    @staticmethod
    def from_str(s: str) -> ListNode:
        values = s.split(",")
        head = ListNode(int(values[0]))
        current = head
        for val in values[1:]:
            current.next = ListNode(int(val))
            current = current.next
        return head


