                safe_tiles.add((i, j))
    # create a dictionary to store the number of zones traversed to escape each safe tile
    escape_count = {}
    # loop through all safe tiles
    for tile in safe_tiles:
        # initialize the current position and set of unvisited neighboring tiles
        current = tile
        unvisited = {tile}
        # loop until the current position is outside of the grid
        while current!= (len(grid) - 1, len(grid[0]) - 1):
            # update the current position
            i, j = current
            # check if the current position is a border or a safe tile
            if (i, j) not in edges and grid[i][j] in safe_tiles:
                # if the current position is a safe tile, add its direction to the set of unvisited neighboring tiles
                unvisited.add((i, j))
            # if the current position is a border, break out of the loop
            elif (i, j) in edges:
                break
            # if the current position is a safe tile, increment the number of zones traversed to escape
            else:
