        def binary_search(distances: List[int], p: int, left: int, right: int) -> int:
            if left > right:
                return distances[left]
            mid = (left + right) // 2
            if mid < p:
                return binary_search(distances, p, mid + 1, right)
            elif mid > p:
                return binary_search(distances, p, left, mid - 1)
