    for i in range(n):
        for j in range(i+1, n):
            graph[i].append((j, distances[i+n*j]))
            graph[j].append((i, distances[i+n*j]))

    def bfs(start: int) -> set:
        queue = [(start, 0)]
        visited = {start}
        distances[start-1] = 0

        while queue:
            v, distance = queue.pop(0)
            if v == n:
                return visited

            for neighbor, new_distance in graph[v]:
                if neighbor not in visited:
                    visited.add(neighbor)
                    queue.append((neighbor, distance + new_distance))

        return visited

    return '\n'.join(f'{v1} {v2}' for v1 in range(1, n) for v2 in bfs(v1))

