    for i in range(N - 1):
        a, b = i + 1, i + 2
        graph[a - 1].append(b - 1)
        graph[b - 1].append(a - 1)

    # bellman-ford algorithm
    dist = [float('inf')] * N
    dist[0] = 0
    for _ in range(N - 1):
        for u in range(N):
            for v in graph[u]:
                if dist[u]!= float('inf') and dist[u] + D[v] < dist[v]:
                    dist[v] = dist[u] + D[v]

    # check if the network is valid
    for u in range(1, N):
        for v in graph[u]:
            if dist[u]!= float('inf') and dist[u] + D[v] < dist[v]:
                return "NO"

    return "YES"

