    n, k = map(int, stdin.split())
    tiles = list(map(int, stdin.split()))

    # create a 2D array to represent the tiles
    tile_matrix = [[0] * n for _ in range(n)]
    for i, tile in enumerate(tiles):
        x, y = divmod(i, n)
        tile_matrix[x][y] = tile

    # BFS to find the shortest path
    visited = set()
    queue = [(0, 0, 0, 0)]  # (distance, x, y, current_tile)
    shortest_distance = float('inf')

    while queue:
        distance, x, y, current_tile = queue.pop(0)

        if (x, y) == (n - 1, n - 1):
            shortest_distance = min(shortest_distance, distance)
            continue

        if (x, y) in visited:
            continue

        visited.add((x, y))

        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            next_x, next_y = x + dx, y + dy
            next_tile = tile_matrix[next_x][next_y]

            if next_tile not in visited and abs(next_tile - current_tile) == 1:
                next_distance = distance + abs(next_tile - current_tile)
                queue.append((next_distance, next_x, next_y, next_tile))

    if shortest_distance == float('inf'):
        return -1
    else:
        return shortest_distance

