    for i, room in enumerate(rooms):
        students[i + 1] += room

    if any(v <= 0 for v in students.values()):
        return "impossible"

    def check_safe_order(start: int, rooms: List[int], students: Dict[int, int]) -> bool:
        count = sum(students.values())
        if count <= start:
            return True

        for i, room in enumerate(rooms):
            if students[i + 1] >= start:
                students[i + 1] -= start
                students[i + 1] += room
                if check_safe_order(start - room, rooms, students):
                    return True
                students[i + 1] -= room

        return False

    for i in range(1, len(rooms) + 1):
        if students[i] > 0:
            return f"{i} {i + 1}"

