    A, B, C, D = int(inputs[0]), int(inputs[1]), int(inputs[2]), int(inputs[3])

    def is_rectangle(x: int, y: int, width: int, height: int) -> bool:
        return 0 <= x <= width and 0 <= y <= height

    def enclose_rectangle(x: int, y: int, width: int, height: int, steps: int) -> bool:
        max_width = max(width, steps)
        max_height = max(height, steps)
        return is_rectangle(x, y, max_width, max_height)

    x, y = 0, 0
    width = 0
    height = 0
    steps = 0

    for i in range(1, 5):
        if i == 1:
            x += A
        elif i == 2:
            y += B
        elif i == 3:
            width += C
        elif i == 4:
            height += D

        if enclose_rectangle(x, y, width, height, steps):
            steps += 1
            x += A
        else:
            x -= A
            y -= B
            width -= C
            height -= D

    return str(max(width, steps))

